import React from 'react';
import AreasItem from '../areas-item';

const AreasList = ({ areas, props }) => {

    const searchText = 'Type here to search your Area!';
    const searchStyle = {
        fontSize: '20px'
    };

    return (
        <section className="areas-block section">
            <div className="_container">
                <div className="search-area">
                    <input placeholder={ searchText } style={ searchStyle } className="foo" value={ props.inputValue } onChange={ props.inputFilterOnchange }/>
                </div>
                <div className="areas-block__slides">
                    <ul className="slides">
                        <li>
                        <div className="row">
                            {areas.map(item => {
                                return <AreasItem key={item.id} area={item} handlePetView={props.handlePetView}/>;
                            })}
                        </div>
                        </li>
                    </ul>
                </div>
            </div>
        </section>
    );
}
export default AreasList;
